<html lang="sv">
<head>
<meta charset="UTF-8">

<title>VGD</title>

<style>

*{
margin:0;
padding:0;
box-sizing:border-box;
}

body{
font-family:"proxima-nova-extra-wide", "Montserrat", -apple-system, BlinkMacSystemFont, sans-serif;
background:#0a0a0a;
color:white;
}

header{
padding:20px;
text-align:center;
border-bottom:1px solid #222;
}

.logo{
font-size:clamp(160px, 40vw, 400px);
letter-spacing:2px;
font-weight:900;
line-height:1;
text-transform:uppercase;
}

.product{
max-width:500px;
margin:auto;
padding:60px 20px 30px 20px;
text-align:center;
}

.product img{
width:100%;
margin-bottom:20px;
}

.product h2{
margin-top:20px;
font-size:22px;
letter-spacing:4px;
font-weight:700;
}

.product .price{
margin-top:8px;
margin-bottom:10px;
font-size:16px;
color:#aaa;
letter-spacing:2px;
}

select,input,button{
width:100%;
padding:14px;
margin-top:10px;
background:#0a0a0a;
border:1px solid #333;
color:white;
font-size:16px;
font-family:"proxima-nova-extra-wide", "Montserrat", sans-serif;
letter-spacing:1px;
}

button{
background:white;
color:black;
font-weight:700;
cursor:pointer;
letter-spacing:2px;
margin-top:20px;
}

label{
display:block;
margin-top:16px;
margin-bottom:2px;
font-size:12px;
letter-spacing:3px;
color:#aaa;
text-align:left;
}

footer{
text-align:center;
padding:40px;
color:#777;
letter-spacing:2px;
font-size:13px;
}

@media (max-width:600px){
.product{
padding:40px 20px 30px 20px;
}
}

</style>
